// Results.js
const Results = (props) => {
    console.log("props of Results", props)

    return (
        <div>
            <p>Date : {props.countryData.date}</p>
            <p>New Infections</p>
            <p>Total Infections to date</p>
            <p>New Recoveries</p>
            <p>Total Recoveries to date</p>
        </div>
    );
};
export default Results;
